import React from 'react';
import "./pages.css";
import {Col} from "react-bootstrap";


import BookMeBanner from "../images/BookMe.jpg"

import {
       Link
  } from 'react-router-dom';

const Santeros = () => {
  return(


    <div className="BookMe">
    <img src={BookMeBanner} width="100%" height= "30%" alt="BookMeBanner"></img>
        <Col xs={6} md={4}>
        <h1>Pedro Bergamo & Los Santeros</h1>
        <p>"Bold, tropical, magical. Can't find the word. It is like Brazilian music delivered by a group of gypsy circus artists. Can't wait for the next gig." - Hilda</p>
        <p>Pedro Bergamo is a Brazilian singer and multi-instrumentist based in Helsinki - Finland. He has a vast repertoire of Brazilian and latin music, besides his original tunes.
        No matter the size of your event, Pedro is the right person to bring warm vibes to your party. He can play solo (acoustic guitar and voice) or with a whole group.</p>
        <h2>Contact for gigs:</h2>
        <p>phone: (+358)406740101</p>
        <p>email: pedrobergamo89@gmail.com</p>
        </Col>

        <Col xs={6} md={4}>
        </Col>
        <iframe width="560" height="315"  className="video"
        src="https://www.youtube.com/embed/DxNS5W3CSqk"
        title="YouTube video player" fframeBorder="0" allow="accelerometer; autoplay; clipboard-write;
        encrypted-media; gyroscope; picture-in-picture"
        allowFullScreen="allowfullscreen"
        mozallowfullscreen="mozallowfullscreen"
        msallowfullscreen="msallowfullscreen"
        oallowfullscreen="oallowfullscreen"
        webkitallowfullscreen="webkitallowfullscreen"></iframe>
        </div>
    );
};

export default Santeros;
